    const month = pros.date.toLocaleString('en-US',{ month: 'long'});
    const day = pros.date.toLocaleString('en-US',{ day: '2-digit'});
    const year = pros.date.getFullYear();

    return (
    <div>
        <div>{day}</div>
        <div>{month}</div>
        <div>{year}</div>
    </div>
    )
}

export default ExpenseDate;
